import React, { useState } from "react";

function Main() {
  const [login, setlogin] = useState(false);
  const [signup, setsignup] = useState(false);
  const log = () => {
    setlogin(true);
  };
  const sign = () => {
    setsignup(true);
  };
  return (
    <div style={{ textAlign: "left" }}>
      <button onClick={()=>log}>
        Login
      </button>
      <button onClick={()=>sign}>SignUp</button>
      <div
        style={{ border: "1px Solid Black", minHeight: "550px", margin: "3px" }}>

      </div>
    </div>
  );
}

export default Main;
